import { createRouter, createWebHistory } from 'vue-router';
import register from '@/views/RegisterForm.vue';
import login from '@'
const routes = [

  {
    path: '/register',
    name: 'Register',
    component: register
  },
  {
    path: '/login',
    name: 'Register',
    component: register
  }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
